import React from 'react';

class App extends React.Component {

  state = {
    isloading: true,
    movie: []
  };

  componentDidMount() {
    setTimeout(() => { this.setState({ isloading: false }) }, 6000);
  }

  render() {
    const { isloading } = this.state.isloading;
    return <div>
      {isloading ? "loading" : "we are ready"}
    </div>;
  }
}

export default App;
